import React from "react";

import QuestionItem from "./QuestionItem"

const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/" + `${id}` + "/question";

class QuestionListItem extends React.Component{

    state = {
        quest:[],
      };

      async componentDidMount(){
        const response = await axios.get(QUIZ_API_BASE_URL);
        this.setState ({quiz: response.data, isLoading: false});
      }

    render(){
        return(
            <ul>
                {this.state.quest.map(q =>{
                    <QuestionItem key={q.id} quest={q}/>
                })}

            </ul>
        )
    }
}

export default QuestionListItem
